import React from "react";
import "./About.css";

const AboutPage = () => {
  return (
    <div className="background">
      <section className="about-section">
        <div className="about-container">
          <h3>Get On Track</h3>
          <p>This project/website is an AI-powered fitness tracker designed to help you monitor workouts, track progress, and receive personalized insights based on your activity and goals.</p>
        </div>
      </section>
    </div>
  );
};

export default AboutPage;
